import React from "react";
import '../assets/styles/CareerBento.scss';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
// Removed faServer from the list below
import { faGraduationCap, faMicrochip, faDatabase, faCode } from '@fortawesome/free-solid-svg-icons';

function CareerBento() {
  return (
    <div className="career-bento-container" id="career">
      <h1>Career Deep Dive</h1>

      <div className="bento-grid-custom deep-dive">
        {/* ROW 1: Education & Quick Stats */}
        <div className="bento-item education-small">
          <div className="bento-header"><FontAwesomeIcon icon={faGraduationCap} /><span>Masters</span></div>
          <h3>MS in Computer Science</h3>
          <p className="school">SUNY Binghamton</p>
          <p className="date">2023 â€“ 2025</p>
        </div>

        <div className="bento-item stats-card">
          <div className="bento-header"><FontAwesomeIcon icon={faCode} /><span>Impact Metrics</span></div>
          <div className="metric"><strong>65%</strong> Latency Reduction</div>
          <div className="metric"><strong>40%</strong> Efficiency Boost</div>
          <div className="metric"><strong>128+</strong> Apps Consolidated</div>
        </div>

        {/* ROW 2: Major Experience & Honors */}
        <div className="bento-item experience-featured">
          <div className="bento-header"><FontAwesomeIcon icon={faDatabase} /><span>LTIMindtree</span></div>
          <h3>Software Engineer</h3>
          <ul className="desc-list">
            <li>Optimized Java microservices for Citi Bank, cutting defects by 25%.</li>
            <li>Migrated legacy PL/SQL logic into Drools rule engines.</li>
          </ul>
        </div>

        <div className="bento-item honors-card">
          <div className="bento-header"><span>Achievements</span></div>
          <ul className="honor-list">
            <li>Spot Award for Excellence in Delivery</li>
            <li>Dean's Honor List - Binghamton University</li>
            <li>F1 Data Analytics Research Project</li>
          </ul>
        </div>

        {/* ROW 3: Technical Ecosystem Pillar */}
        <div className="bento-item technical-skills-fullwidth">
          {/* Existing skills content here, but spread across the grid */}
        </div>
      </div>
    </div>  
  );
}

export default CareerBento;
